  false,\n\t\"url\": null,\n\t\"notes\": \"Backscatter imagery extracted from gridded
  bathymetry of Penguin Bank, Molokai, Hawaii, USA. These data provide almost complete
  coverage between 0 and 100 meters. The backscatter dataset includes Simrad EM3002d
  and Reson 8101 data. The sonars frequencies are 300 kHz and 240 kHz respectively
  and are processed and gridded separately. Because of the similar sonar frequencies
  the data can be mosaicked nearly seamlessly using GIS software. This metadata is
  for the Reson 8101 backscatter data only.\",\n\t\"license_title\": null,\n\t\"extras\":
